ENGLISH:
Chae-yi ended up staying at the home of Gun-woo, a close friend who had eloped with his girlfriend to avoid a family custom. As she enjoyed her solitary hours, soaking in the bathtub and watching the Manhattan night scene, she didn't know that a man was approaching her ... - &quot;You approached Noh Jae-hyuk to jump into bed with him, didn't you?&quot; - &quot;That's the most ridiculous thing I've ever heard!&quot; - &quot;Does that sound like a lie to you?&quot;

ESPA&Ntilde;OL:
Chae-yi termin&oacute; qued&aacute;ndose en la casa de Gun-woo, un amigo cercano que se hab&iacute;a fugado con su novia para evitar una costumbre familiar. Mientras disfrutaba de sus horas solitarias, sumergi&eacute;ndose en la ba&ntilde;era y mirando la escena nocturna de Manhattan, no sab&iacute;a que un hombre estaba aproxim&aacute;ndose a ella ... - &quot;Te acercaste a Noh Jae-hyuk para saltar a la cama con &eacute;l, &iquest;no es as&iacute;?&quot; - &quot;&iexcl;Eso es lo m&aacute;s rid&iacute;culo que he escuchado!&quot; - &quot;&iquest;Te parece una mentira?&quot;
